import { EventsList } from '../TextInfo';


const Events = () => {
    return (
        <span>
            {EventsList.map( ( item, index ) => {
                let background = {
                    backgroundImage: `url(../images/event/${item})`,
                };
                return (
                    <span key={index}>
                        Hello
                        <div className='exp_location_img' style={background}></div>
                    </span>
                );
            } )}
        </span>
    );
}
export default Events
